from GF2 import *def vec_dot_product(v,u):    t = 0;    for i in range(len(v)):        t = t + v[i]*u[i]    return tu1 = [2,3,-4,1]u2 = [1,-5,2,0]u3 = [4,1,-1,-1]all_set = ([x1,x2,x3,x4] for x1 in range(-10,10) for x2 in range(-10,10) for x3 in range(-10,100) for x4 in range(-10,10))for vec in all_set:    if 10 == vec_dot_product(vec,u1) and 35 == vec_dot_product(vec,u2) and 8 == vec_dot_product(vec,u3):        print(vec)        exit()